import React from 'react';
import Button from './Button';
import '../styles/Buttons.css';

class Buttons extends React.Component{
	render(){


		return(
			<div className='container'>
				 <div className='column'>
					 <Button number='7'/>
					 <Button number='4'/>
					 <Button number='1'/>
					 <Button number='0'/>
				</div>
				 <div className='column'>
				 	<Button number='8'/>
				 	<Button number='5'/>
				 	<Button number='2'/>
				 	<Button number='0'/>
				</div>
				<div className='column'>
					 <Button number='9'/>
					 <Button number='6'/>
					 <Button number='3'/>
					 <Button number='0'/>
				</div>
				<div className='column'>
					 <Button number='x'/>
					 <Button number='-'/>
					 <Button number='+'/>
					 <Button number='='/>
				</div>
			</div>

		);
	}
}

export default Buttons;
